import '../styles/Players.css';
const axios = require('axios');


const PlayersScreen = () => {
    let { id } = useParams();
    const [playerInfo, setPlayerInfo] = useState([
        {
            "id": 223071,
            "shortName": "O. Tufan",
            "firstName": "Ozan",
            "middleName": "",
            "lastName": "Tufan",
            "birthDate": "1995-03-23T00:00:00.000Z",
            "birthArea": {
                "id": 792,
                "alpha2code": "TR",
                "alpha3code": "TUR",
                "name": "Turkey",
                "iconcode": "tr"
            },
            "passportArea": {
                "id": 792,
                "alpha2code": "TR",
                "alpha3code": "TUR",
                "name": "Turkey",
                "iconcode": "tr"
            },
            "role": {
                "name": "Midfielder",
                "code2": "MD",
                "code3": "MID"
            },
            "foot": "right",
            "currentTeamId": 4487,
            "image": "https://kuzguncuk.comparisonator.com/static/players/223071.png"
        },
    ]);

    /*useEffect(() => {
       axios.get('https://mock-foooty-api.herokuapp.com/teams/'+ id +'/players').then(function(response){
           console.log(response);
       })
   }, []);*/

    return(
        <div className="playersContainer">
            <div className="titles">
                <h3>Image</h3>
                <h3>Image</h3>
                <h3>Image</h3>
                <h3>Image</h3>
                <h3>Image</h3>
            </div>
            {playerInfo.map((player) => (
                <Player key={player.id} prop={player}/>
            ))}
        </div>
    )
}

export default PlayersScreen;
